import React from 'react';
import sendPost from './api/hook';
import logo from './logo.svg';
import './App.css';

const data = sendPost('http://localhost:8080/recentword',{test:'data'});
function Display() {
	return (
		<p>{data}</p>
	);
}

function App() {
  return (
	  <div className="App">
	  	<header className="App-header">
	  		<img src={logo} className="App-logo" alt="logo" />
	  	</header>
	  </div>
  );
}

export default App;
